DROP PROCEDURE IF EXISTS `AddAttendanceRecord`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `AddAttendanceRecord` (IN `studentId` VARCHAR(10), IN `officerId` VARCHAR(10))  BEGIN
    DECLARE currentStatus VARCHAR(50);
    DECLARE roomId INT(50);    
    
    SET currentStatus = GetCurrentStatus(studentId);
    SET roomId=GetRoomIdByStudentId(studentId);

    IF roomId=0 THEN
        SELECT "Warning";
    ELSE

        IF currentStatus = 'leave' THEN
            
            INSERT INTO attendance (student_id, security_officer_id, room_id, date_and_time, status)
            VALUES (studentId, officerId, roomId, NOW(), 'In');

            SELECT "Done";
        ELSEIF currentStatus = 'In' THEN
                
            INSERT INTO attendance (student_id, security_officer_id, room_id, date_and_time, status)
            VALUES (studentId, officerId, roomId, NOW(), 'leave');

            SELECT "Done";
        ELSE
            
            INSERT INTO attendance (student_id, security_officer_id, room_id, date_and_time, status)
            VALUES (studentId, officerId, roomId, NOW(), 'In');

            SELECT "Done";
        END IF;
    END IF;
END$$

DROP PROCEDURE IF EXISTS `GetAllRoomNumbers`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllRoomNumbers` ()  BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE roomNumber INT;
    DECLARE roomCount INT;


    DECLARE roomCursor CURSOR FOR SELECT room_id FROM room;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;


    CREATE TEMPORARY TABLE IF NOT EXISTS RoomResults (room_id INT, student_count INT);

    OPEN roomCursor;

    read_loop: LOOP
        FETCH roomCursor INTO roomNumber;

        IF done = 1 THEN
            LEAVE read_loop;
        END IF;

        SET roomCount = GetRoomStudentCount(roomNumber);

        
        INSERT INTO RoomResults (room_id, student_count) VALUES (roomNumber, roomCount);
    END LOOP;

    CLOSE roomCursor;


    SELECT * FROM RoomResults;

    DROP TEMPORARY TABLE IF EXISTS RoomResults;
END$$

