DROP TRIGGER IF EXISTS `InsertStudentUpdateRoomStatus`;
DELIMITER $$
CREATE TRIGGER `InsertStudentUpdateRoomStatus` AFTER INSERT ON `student` FOR EACH ROW BEGIN
    DECLARE room_status INT;
    
    IF NEW.room_id IS NOT NULL THEN
        SELECT CheckRoomStatus(NEW.room_id) INTO room_status;

        IF room_status = 0 THEN
            UPDATE room
            SET status = 'Occupied'
            WHERE room_id = NEW.room_id;
        END IF;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `UpdateRoomStatus`;
DELIMITER $$
CREATE TRIGGER `UpdateRoomStatus` AFTER UPDATE ON `student` FOR EACH ROW BEGIN
    IF NEW.room_id <> OLD.room_id THEN
        SET @room_status = CheckRoomStatus(NEW.room_id);

        IF @room_status = 0 THEN
            UPDATE room
            SET status = 'Occupied'
            WHERE room_id = NEW.room_id;
        END IF;

        SET @old_room_student_count = GetRoomStudentCount(OLD.room_id);

        IF @old_room_student_count = 0 THEN
            UPDATE room
            SET status = 'Vacant'
            WHERE room_id = OLD.room_id;
        END IF;
    END IF;
END
$$
DELIMITER ;
